import React from "react";


const Flower = (props) => {
    return (
        <>

            <div className="cards">
                <h2>{props.title}</h2>
                <img src="https://images.pexels.com/photos/462402/pexels-photo-462402.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" alt="rose" />

                <p>Content is information produced and directed at an end-user or audience in the sectors of publishing, art, and communication. Content is delivered via different media, including the Internet, cinema, television, radio, audio CDs, books and magazines, physical art, and during live events</p>
                <button>Read More</button>
                <hr />
            </div>



        </>
    )

}

export default Flower;
